embedfield:
Speed up aggregation on large collection<p>I currently have a database with about 270 000 000 documents. They look like this:</p>

<pre><code>[{
    'location': 'Berlin',
    'product': 4531,
    'createdAt': ISODate(...),
    'value': 3523,
    'minOffer': 3215,
    'quantity': 7812
},{
    'location': 'London',
    'product': 1231,
    'createdAt': ISODate(...),
    'value': 53523,
    'minOffer': 44215,
    'quantity': 2812
}]
</code></pre>

<p>The database currently holds a bit over one month of data and has ~170 locations (in EU and US) with ~8000 products. These documents represent timesteps, so there are about ~12-16 entries per day, per product per location (at most 1 per hour though).<br>
My goal is to retrieve all timesteps of a product in a given location for the last 7 days. For a single location this query works reasonable fast (150ms) with the index <code>{ product: 1, location: 1, createdAt: -1 }</code>.  </p>

<p>However, I also need these timesteps not just for a single location, but an entire region (so about 85 locations). I'm currently doing that with this aggregation, which groups all the entries per hour and averages the desired values:</p>

<pre class="lang-js prettyprint-override"><code>    this.db.collection('...').aggregate([
      { $match: { { location: { $in: [array of ~85 locations] } }, product: productId, createdAt: { $gte: new Date(Date.now() - sevenDaysAgo) } } }, {
        $group: {
          _id: {
            $toDate: {
              $concat: [
                { $toString: { $year: '$createdAt' } },
                '-',
                { $toString: { $month: '$createdAt' } },
                '-',
                { $toString: { $dayOfMonth: '$createdAt' } },
                ' ',
                { $toString: { $hour: '$createdAt' } },
                ':00'
              ]
            }
          },
          value: { $avg: '$value' },
          minOffer: { $avg: '$minOffer' },
          quantity: { $avg: '$quantity' }
        }
      }
    ]).sort({ _id: 1 }).toArray()
</code></pre>

<p>However, this is really really slow, even with the index <code>{ product: 1, createdAt: -1, location: 1 }</code> (~40 secs). Is there any way to speed up this aggregation so it goes down to a few seconds at most? Is this even possible, or should I think about using something else?<br>
I've thought about saving these aggregations in another database and just retrieving that and aggregating the rest, this is however really awkward for the first users on the site who have to sit 40 secs through waiting.</p>

